Logistics by Gurtam, the developer of Wialon satellite tracking system, is created specifically for distribution companies and delivery services. The new order management application is designed to use with Logistics web-service on the part of couriers and drivers.  

With Logistics Mobile installed your smartphone becomes the point where the office encounters the field. 

Getting started is easy: create a driver with phone number and mobile key in Wialon system, assign him to a unit and authorize in the app using the mobile number. 

Try now to automate order management with the advanced functions: 
- view the list of orders and detailed information on each;
- track and evaluate delivery progress;
- observe orders and estimated routes on the map;
- receive push-notifications on relevant events regarding orders, routes, and delivery process;
- make a detailed route to an order using external navigational applications;
- assign status to each order (confirmed/rejected), add comments and photos; 
- chat with operators to notify them about any circumstances considering delivery;
- confirm delivery by attaching a photo with customer signature to an order with data on customer name, delivery time and date indicated on a photo;
- enjoy tablet-optimized interface to simultaneously view orders in tables and on the map;
- option to use your smartphone as a tracker. 

We offer advanced courier assistant on every stage of delivery. 

Note: 
If you have any questions, please feel free to contact our technical support team at support@gurtam.com

Continued use of GPS running in the background can dramatically decrease battery life.
